<span class="token comment">// 3. \u6211\u4EEC\u600E\u4E48\u77E5\u9053\u8BE5\u5143\u7D20\u6CA1\u6709\u5B58\u5728\uFF1F \u5229\u7528 \u65B0\u6570\u7EC4.indexOf(\u6570\u7EC4\u5143\u7D20) \u5982\u679C\u8FD4\u56DE\u65F6 -1 \u5C31\u8BF4\u660E\u65B0\u6570\u7EC4\u91CC\u9762\u6CA1\u6709\u6539\u5143\u7D20</span>
